function Education () {
    return (
        <>
            <div id="education" class="education">
                <h1>Education</h1>
                <div class="degree">
                    <h2>Toronto Metropolitan University</h2>
                    <p>Computer Science- BSc.(Hons)</p>
                    <p>Sept 2022 - Present</p>
                </div>
            </div>
        </>
    );
}

export default Education;
